fullText:
@MuskBreaking Thanks George ❤️ 

We redirected everyone who wasn’t building cars to delivering cars – legal, finance, HR, designers, everyone. I personally delivered many cars. 

Tesla was out of cash, so it was a case of deliver or die. The team delivered.

@SawyerMerritt Ethan is very talented, but “vision chief” would be overstating things. 

There are over 200 excellent engineers in the Tesla AI/Autonomy team. Tesla’s pace of progress with autonomy is accelerating. 

The talent war for AI is the craziest talent war I’ve ever seen!

@alex_avoigt Most people still have no idea how crushingly good Tesla FSD will get.

It will be superhuman to such a degree that it will seem strange in the future that humans drove cars, even while exhausted and drunk!

Cars will take you where you want automatically, just like getting in an

@BasedBeffJezos Austin is awesome. 

Gaining critical mass of tech talent fast. 

The Tesla AI inference chips in all our cars were designed by our Austin team.

