@thejefflutz @Tesla This is fake news. 

Protesters did not manage to break through the fenceline. There are still 2 intact fence lines all around. 

Note, this is “National Protest Week” in Germany, so there are a lot of protests for many different reasons.

@ajtourville @Tesla I’ve always felt that the climate predictions were too pessimistic and bound to backfire. 

Extreme environmentalists can’t say ridiculous things like the world is doomed in 5 years, because 5 years goes by, the world is ok and they lose credibility. 

If we transition to
